webpackJsonp([0x473acf5d11bba800],{"./node_modules/json-loader/index.js!./.cache/json/vim-split.json":function(e,o){e.exports={data:{markdownRemark:{html:"<h1>Opening Files in Vim with Split</h1>\n<p>In Vim, files can be opened or <code>split</code> horizontally and vertically to create an additional window or viewport for a given file.</p>\n<h3>Command Keys</h3>\n<p>The commands for creating a horizontal split:</p>\n<p>:<code>[N]split</code> <code>[file]</code></p>\n<p>:<code>[N]sp</code> <code>[file]</code></p>\n<p>where <code>sp</code> is the short abbreviation for <code>split</code>.</p>\n<p>The commands for creating a vertical split:</p>\n<p>:<code>[N]vsplit</code> <code>[file]</code></p>\n<p>:<code>[N]vs</code> <code>[file]</code></p>\n<p>where <code>vs</code> is the short abbreviation for <code>vsplit</code> andâ€¦</p>\n<ul>\n<li><code>[N]</code> is the height (defaults to half current window).</li>\n<li><code>[file]</code> is the file to open in the new split window (current file used if none given).</li>\n</ul>\n<h3>Examples</h3>\n<p>Some examples of using split in Vim:</p>\n<ul>\n<li>:<code>sp</code> Split the current window into equal horizontal windows for the current file.</li>\n<li>:<code>10sp</code> Split the current window creating a new window with height 10 for the current file.</li>\n<li>:<code>sp</code> <code>index.html</code> Split the current window into equal horizontal windows and open <code>index.html</code> in the new window.</li>\n<li>:<code>vs</code> <code>main.css</code> Split the current window into equal vertical windows and open <code>main.css</code> in the new window.</li>\n</ul>",fields:{slug:"/vim/split/"},frontmatter:{title:"Split"}}},pathContext:{slug:"/vim/split/"}}}});
